import Vue from 'vue';
import types from './CandidateType';

export default Vue.extend({
    name: "CandidateTypeDropdown",
    props: ["value"],
    data() {
        return {
            types,
            current: 0,
        }
    },
    methods: {
        choose(idx: number): void
        {
            this.current = idx;
            this.$emit("input", this.types[idx].value);
        }
    },
    created(): void {
        this.choose(0);
    }
});
